a sources with an year attribute whose value is greater than or equal to \'1989\': <code>"greaterThanOrEquals": { "key": "year", "value": 1989 }</code> </p>', 'RetrievalFilter$lessThan' => '<p>Knowledge base data sources are returned if they contain a metadata attribute whose name matches the key and whose value is less than the value in this object.</p> <p>The following example would return data sources with an year attribute whose value is less than to \'1989\': <code>"lessThan": { "key": "year", "value": 1989 }</code> </p>', 'RetrievalFilter$lessThanOrEquals' => '<p>Knowledge base data sources are returned if they contain a metadata attribute whose name matches the key and whose value is less than or equal to the value in this object.</p> <p>The following example would return data sources with an year attribute whose value is less than or equal to \'1989\': <code>"lessThanOrEquals": { "key": "year", "value": 1989 }</code> </p>', 'RetrievalFilter$in' => '<p>Knowledge base data sources are returned if they contain a metadata attribute whose name matches the key and whose value is in the list specified in the value in this object.</p> <p>The following example would return data sources with an animal attribute that is either \'cat\' or \'dog\': <code>"in": { "key": "animal", "value": ["cat", "dog"] }</code> </p>', 'RetrievalFilter$notIn' => '<p>Knowledge base data sources are returned if they contain a metadata attribute whose name matches the key and whose value isn\'t in the list specified in the value in this object.</p> <p>The following example would return data sources whose animal attribute is neither \'cat\' nor \'dog\': <code>"notIn": { "key": "animal", "value": ["cat", "dog"] }</code> </p>', 'RetrievalFilter$startsWith' => '<p>Knowledge base data sources are returned if they contain a metadata attribute whose name matches the key and whose value starts with the value in this object. This filter is currently only supported for Amazon OpenSearch Serverless vec